        #region Overridden methods
        protected override void OnActionExecuting(ActionExecutingContext filterContext)
        {
            if (System.Web.HttpContext.Current.Session["UserToken"] is TokenModel token)
            {
                ViewBag.Role = System.Web.HttpContext.Current.Session["Role"];
                var user = System.Web.HttpContext.Current.Session["UserModel"] as UserModel;
                ViewBag.Name = user.Name;
                ViewBag.Email = user.Email;
                ViewBag.Image = user.Image == "" ? 
                    "data:image/png;base64,"
                    : $"data:image/jpg;base64,{user.Image}";
                Token = token;
                System.Web.HttpContext.Current.Session.Timeout = Utility.SessionTimeout;
                base.OnActionExecuting(filterContext);
            }
            else
            {
                filterContext.Result = RedirectToAction("Index", "Login");
            }
        }
        /// <summary>
        /// Returns json result with allow get behaviour
