            return await SendGetRequest<T>(url);
        }

        protected async Task<object> GetAsync<T>(string controller, string action)
        {
            var url = controller + (action != "" ? "/" + action : "");
            return await SendGetRequest<T>(url);

        }

        private async Task<object> SendGetRequest<T>(string url)
        {
            try
            {
                using (var client = GetHttpClient())
                {
                    HttpResponseMessage response = await client.GetAsync(url);
                    if (response.IsSuccessStatusCode)
                    {
                        var result = await response.Content.ReadAsAsync<SuccessModel<List<T>>>();
                        return result.MainData;
                    }
                    else if (response.StatusCode == HttpStatusCode.Unauthorized)
                    {
                        var result = await RefreshTokenAsync();
                        if (result)
                        {
                            using (var childClient = GetHttpClient())
                            {
                                response = await childClient.GetAsync(url);
                                if (response.IsSuccessStatusCode)
                                {
                                    var childResult = await response.Content.ReadAsAsync<SuccessModel<List<T>>>();
                                    return childResult.MainData;
                                }
                                else
                                {
                                    return await GetErrorResponseAsync(response);
                                }
                            }
                        }
                        else
                        {
                            return await GetErrorResponseAsync(new HttpResponseMessage(HttpStatusCode.Unauthorized));
                        }
                    }
                    else
                    {
                        return await GetErrorResponseAsync(response);
                    }
                }
            }
            catch (Exception ex)
            {
                return Error(ex);
            }
        }
