        #region Error handling extensions
        protected ActionResult Throw(Exception ex)
        {
            System.Web.HttpContext.Current.Session["EX"] = ex;
            return RedirectToAction("", "Exception");
        }

        protected ActionResult Error(Exception exception)
        {
            var ex = exception;
            StringBuilder builder = new StringBuilder();
            List<ValueTuple<string, string>> exceptions = new List<ValueTuple<string, string>>();

            var message = ex.Message;
            var type = ex.GetType().Name;
            var caption = string.Concat(type.Select(x => char.IsUpper(x) ? $" {x}" : x.ToString())).Trim();
            builder.Append($"{caption}: {message}");

            while (ex.InnerException != null)
            {
                ex = ex.InnerException;
                message = ex.Message;
                type = ex.GetType().Name;
                caption = string.Concat(type.Select(x => char.IsUpper(x) ? $" {x}" : x.ToString())).Trim();
                exceptions.Add((caption, message));
            }

            foreach (var item in exceptions)
            {
                var line = $"{item.Item1}: {item.Item2}";
                builder.AppendLine(line);
            }

            //HttpContext.Response.StatusCode = 520;
            return new ErrorResult(new ErrorModel { Caption = "Top Level Error Occured", Message = builder.ToString() });
        }
        #endregion

        #region Helping methods
        private HttpClient GetHttpClient()
        {
            var client = new HttpClient { BaseAddress = new Uri(SERVERADDRESS) };
            client.DefaultRequestHeaders.Accept.Clear();
            client.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));
            client.DefaultRequestHeaders.Authorization =
                new AuthenticationHeaderValue("Bearer", Token.AccessToken);
            return client;
        }
        private async Task<ActionResult> GetErrorResponseAsync(HttpResponseMessage httpResponse)
        {
            var result = new ErrorModel();

            switch ((int)httpResponse.StatusCode)
            {
                case 409:
                    result.Message = await httpResponse.Content.ReadAsAsync<string>();
                    result.Caption = "Record Exists";
                    break;
                case 520:
                    result = await httpResponse.Content.ReadAsAsync<ErrorModel>();
                    break;
                default:
                    var status = httpResponse.StatusCode.ToString();
                    result.Caption = string.Concat(status.Select(x => char.IsUpper(x) ? $" {x}" : x.ToString())).Trim();
                    try
                    {
                        using (var reader = new StreamReader(await httpResponse.Content.ReadAsStreamAsync()))
                        {
                            result.Message = reader.ReadToEnd();
                        }
                    }
                    catch
                    {
                        result.Message = "Unknown";
                    }
                    break;
            }
            return new ErrorResult(result);
        }

        private async Task<bool> RefreshTokenAsync()
        {
            var client = new HttpClient { BaseAddress = new Uri(SERVERADDRESS) };
            client.DefaultRequestHeaders.Accept.Clear();
            client.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));
            client.DefaultRequestHeaders.Authorization =
                new AuthenticationHeaderValue("Bearer", Token.RefreshToken);
            var response = await client.GetAsync("RenewToken");
            if (response.IsSuccessStatusCode)
            {
                var token = await response.Content.ReadAsAsync<SuccessModel<TokenModel>>();
                Token = token.MainData;
                System.Web.HttpContext.Current.Session["UserToken"] = Token;
                return true;
            }
            else
            {
                return false;
            }
        }
        #endregion
    }
}